import React from "react";
import Navbar from "../components/Navbar";
import Image1 from "../assets/TREEPEEPS.png";

function HomePage(){
return(
    <div style={{ 
      backgroundImage: `url(${Image1})`
    }}>
        <Navbar />
        
    <div>
        <h1>TreePeeps</h1>
        <button>Login</button>
        <button>Sign Up</button>
    </div>
    </div>

)
}

export default HomePage;
